script: |
  super -f text -I q5753.spq | sort > q5753.out

inputs:
  - name: q5753.spq
    data: |
      SELECT DISTINCT + - 84 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0, tab0 (FORMAT parquet) AS cor1, tab2 (FORMAT parquet), tab0 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5753.out
    data: |
      -84
